// *** A component in react is just a javascript function ***

function ExpenseItem() {
  return (
    //you cannot return multiple things, so wrap everything in <div>
    <div>
      <div>June 4th, 2021</div>
      <div>
        <h2>Car Insurance</h2>
        <div>$294.67</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
